{"4": ["Перепутали Т-1021 с Т-1050", "2020-12-20T17:27:48Z", "", "0", 0, 1, 1, "ЗАРЯДНО-ДИАГНОСТИЧЕСКИЙ ПРИБОР Т-1021", "АВТОЭЛЕКТРИКА"], "5": ["Вместо т-1021 пришел т-1050 г. Миасс. Очень жалко что приход товаров так и не исправили...", "2020-12-08T14:12:56Z", "", "0", 0, 1, 1, "ЗАРЯДНО-ДИАГНОСТИЧЕСКИЙ ПРИБОР Т-1021", "АВТОЭЛЕКТРИКА"], "6": ["Заказывал т-1021 пришел т-1050.. Г. Миасс. Неужели нельзя исправить приход товаров, или попросить проверять поставщиков перед отправкой - ведь это же не трудно.", "2020-12-03T12:26:28Z", "", "0", 1, 1, 1, "ЗАРЯДНО-ДИАГНОСТИЧЕСКИЙ ПРИБОР Т-1021", "АВТОЭЛЕКТРИКА"], "8": ["сегодня пришла получать зарядное устройство автоэлектрик  Т 1021, однако как и у всех один сценарий подкладывают абсолютно другое устройство Т1050 дешевле. И можно было списать на ошибку, но судя по отзывам, такая ситуация продолжается довольно давно, а это попахивает мошенничеством, т.к. доставку могла попросить забрать ребенка, надеясь на порядочность Валдберрис.Репутация компании начинает падать с мелочей и это не очень приятный момент.", "2020-12-05T17:03:12Z", "", "0", 0, 1, 1, "ЗАРЯДНО-ДИАГНОСТИЧЕСКИЙ ПРИБОР Т-1021", "АВТОЭЛЕКТРИКА"], "9": ["Заказывал т1021 пришёл т1050 !\r\nСудя по отзывам, это происходит постоянно!!!\r\nПрошу заменить.", "2020-11-27T07:16:04Z", "", "0", 0, 1, 1, "ЗАРЯДНО-ДИАГНОСТИЧЕСКИЙ ПРИБОР Т-1021", "АВТОЭЛЕКТРИКА"], "11": ["Пришёл другой, вы не исправили пересорт на складе. Очень жаль, заказывал в подарок, теперь придётся перезаказывать в другом месте.", "2020-11-27T06:11:30Z", "", "0", 0, 1, 1, "ЗАРЯДНО-ДИАГНОСТИЧЕСКИЙ ПРИБОР Т-1021", "АВТОЭЛЕКТРИКА"], "14": ["Проработал два дня и больше не включился. Вот это качество ! (\r\nСпасибо Wildberries, что хоть возврат одобрили без проблем.\r\nК покупке данный прибор, конечно не рекомендую!", "2020-07-14T13:50:31.087308225Z", "colorless", "0", 2, 1, 1, "ЗАРЯДНО-ДИАГНОСТИЧЕСКИЙ ПРИБОР Т-1021", "АВТОЭЛЕКТРИКА"], "15": ["Пришел тот,что на фото. Покупался на подарок, сразу поставили заряжать аккумулятор. Если ,что дополню отзыв. В отзывах пишут ,что нормально служит. Из минусов-провода короткие ,хотелось бы ,чтобы производитель не экономил -  и крокодилы и провода можно сделать побольше и длиннее. В комплекте коробка, документы и сам аппарат (думал ещё чего-нибудь положат ). В целом нормальный аппарат можно смело заказывать.", "2020-05-30T11:51:34.945879557Z", "colorless", "0", 0, 2, 5, "ЗАРЯДНО-ДИАГНОСТИЧЕСКИЙ ПРИБОР Т-1021", "АВТОЭЛЕКТРИКА"], "16": ["Заказывал т1021 пришёл т1050 заказал          ещё раз, посмотрим", "2020-04-24T18:22:12.688589926Z", "colorless", "0", 2, 0, 1, "ЗАРЯДНО-ДИАГНОСТИЧЕСКИЙ ПРИБОР Т-1021", "АВТОЭЛЕКТРИКА"], "18": ["Пришёл вообще нет тот прибор и другой модели!! Пришлось отказаться!!", "2020-04-24T10:59:22.345010284Z", "colorless", "0", 1, 0, 1, "ЗАРЯДНО-ДИАГНОСТИЧЕСКИЙ ПРИБОР Т-1021", "АВТОЭЛЕКТРИКА"]}
